Pete Townshend and Roger Daltrey are on blistering form 
in a session recorded at the Roundhouse in north London, 
as the grand finale of the BBC's Electric Proms in 2006. 
The setlist showcases a sprinkling of songs from their new 
mini-opera Wire and Glass, but it's also packed with big 
singalong tunes like My Generation, Who Are You
Baba O'Riley and Pinball Wizard.

